import React from "react";
import "../App.css";
import { Tabs, TabList, Tab, Image } from '@chakra-ui/react'
import { extendTheme } from "@chakra-ui/react";

// Extend the default Chakra UI theme with your custom styles
const theme = extendTheme({
  components: {
    Tabs: {
      baseStyle: {
        tab: {
          textDecoration: "underline solid transparent",
          transition: "text-decoration 1s ease",
          _hover: {
            textDecoration: "underline solid Currentcolor"
          }
        }
      }
    }
  }
});

function HeaderBar() {
    return (
  <div style={{ display: 'flex', justifyContent: 'space-between' }}>
    <Tabs variant="unstyled">
      <TabList>
        <Tab>Khyle Dhanani's Personal Website!</Tab>
      </TabList>
    </Tabs>
    <Tabs variant="unstyled">
      <TabList>
        <Tab><Imagemage src="../logo.svg"/></Tab>
      </TabList>
    </Tabs>
    <Tabs variant="unstyled" theme={theme}>
      <TabList>
        <Tab>About</Tab>
        <Tab>Projects</Tab>
        <Tab>Resume</Tab>
        <Tab>Github</Tab>
      </TabList>
    </Tabs>
  </div>
); }

export default HeaderBar;
